import React from 'react';

import NavigationButton from './../../components/NavigationButton.js'
import BackButton from './../../components/BackButton.js'
import './Design.css';

function Design() {
  return (
    <div className="Design-Landing">
        <div className="Design-Opaque">
            <div className="Design-Text">
                <BackButton link="/" text="BACK"/>
                <div className="Design-Text-title">
                    Choose a Design.
                    </div>
                    <NavigationButton link="/begin" text="Assisted Design"/>
                    <NavigationButton link="/begin" text="Individual Design"/>
                <div className="Design-Text-subtitle">
                    WHAT DOES THIS MEAN?
                </div>
            </div>
        </div>
    </div>
  );
}

export default Design;
